string input = "";
const int w = 14;

int[] seen = new int[128];
int diff = 0;
for (int i = 0; i < input.Length; ++i)
{
    if (i - w >= 0)
    {
        seen[input[i - w]]--;
        if (seen[input[i - w]] == 0)
            diff--;
    }
    if (seen[input[i]] == 0)
        diff++;
    seen[input[i]]++;
    if (diff == w)
    {
        Console.WriteLine(i + 1);
        break;
    }
}
